import React from 'react';

const WorkoutExample = [
    {
      id: 1,
      title: 'Cardio Blast',
      description: 'High-intensity cardio workout to boost your endurance and burn calories.',
      imageUrl: '#',
      altText: 'Cardio Workout Image',
    },
    {
      id: 2,
      title: 'Strength Training',
      description: 'Build strength and muscle mass with effective resistance training exercises.',
      imageUrl: '#',
      altText: 'Strength Training Image',
    },
  ];

function Workouts() {
    return (
        <div className="hero">
            <div className="hero-content">
                <div className="text-content">
                    <h1>Ready. Set.</h1>
                    <h2>Workout plan for the week</h2>
                    <p>Be the best version of yourself.</p>
                </div>
                <div className="feature-image">
                    <img src="exercising.png" alt="Exercise Illustration" />
                </div>
            </div>
        </div>
    );
}

export default Workouts;
